          "distinct": false,
          "id": "5c6e628a3e1eec4d4efeef1d41c350b0ec93f6a0",
          "message": "feat: Add HTTP proxy support for OTLP/OTAP gRPC exporters (#1679)\n\nfixes: #1678\n\n  ## Summary\n\n  Implements HTTP CONNECT proxy support for OTLP/OTAP gRPC exporters:\n\n- `HTTP/1.1 CONNECT` tunneling to the proxy for both `http://` targets\n(gRPC over h2c inside the tunnel) and `https://` targets (TLS inside the\ntunnel).\n- Environment variable support (`HTTP_PROXY`, `HTTPS_PROXY`, `NO_PROXY`,\n`ALL_PROXY`)\n  - NO_PROXY with CIDR notation (e.g., `192.168.0.0/16`, `10.0.0.0/8`)\n- Configures TCP socket options (`TCP_NODELAY` + `keepalive`). When\nusing a proxy, these are applied to the TCP connection to the proxy (the\nsame connection that carries the CONNECT tunnel).\n- Explicit rejection of `https://` proxy URLs with helpful error\nmessages\n\n  ## Why OTLP/OTAP exporters need custom proxy implementation\n\n**Azure Monitor and Geneva exporters** use the `reqwest` HTTP client,\nwhich provides built-in proxy support via `reqwest::Proxy::all()` - no\ncustom code needed.\n\n  **OTLP/OTAP exporters** use gRPC (`tonic`), which:\n  - Has no built-in proxy support\n  - Requires custom TCP connectors with `tower::service_fn`\n  - Needs manual HTTP CONNECT tunnel implementation for proxy traversal\n\nThis PR implements the missing proxy infrastructure for gRPC-based\nexporters.\n\n  ## Changes\n\n- `proxy.rs`: HTTP/1.1 CONNECT tunnel implementation with socket option\nhandling\n  - `client_settings.rs`: Integration with tonic via custom connector\n  - Dependencies: Added `socket2` and `ipnet` crates\n\n\n## How HTTP CONNECT Tunneling Works\n\n**Step 1: THE HANDSHAKE**\nThe Exporter creates a TCP connection to the Proxy and sends a plaintext\nrequest. The Proxy establishes a TCP leg to the Backend.\n\n```\n  TCP + HTTP/1.1 CONNECT backend:PORT       \n Exporter   >.   Proxy   \n < 200 Connection Established  \n```\n\n**Step 2: THE DATA TUNNEL**\n\nOnce the 200 is received, the Exporter uses the socket for the actual\nOTLP data. The Proxy merely moves bytes back and forth.\n\n```\n              \n OTLP/OTAP   TCP     Proxy     TCP      Backend    \n Exporter  > (relays)  >               \n              \n                                               \n          \n     On-the-wire protocol inside the tunnel (opaque to proxy):\n     - Case 1 (TLS): TLS + gRPC over HTTP/2 (HTTP/2 negotiated via ALPN)\n     - Case 2 (h2c): gRPC over HTTP/2 cleartext (HTTP/2 prior knowledge)\n```\n\n## Test Setup:\n\nThe implementation was verified via a manual end-to-end test setup (not\nincluded in the PR). The architecture below was used to validate proxy\ntraversal for both h2c and TLS traffic:\n\n  ```\n  \n   Fake Data Gen    Generates test telemetry (logs/traces/metrics)\n  \n           \n           \n  \n   OTAP Exporter    gRPC client with proxy configuration\n   (df_engine)       HTTP_PROXY=http://localhost:8080\n                     grpc_endpoint=http://remote:4317\n   admin_port: 8081 (changed to avoid proxy conflict)\n  \n           \n            HTTP CONNECT tunneling\n           \n  \n     mitmproxy      Intercepts and logs proxy traffic\n     :8080          (validates CONNECT requests are working)\n  \n           \n           \n  \n   OTel Collector   Receives telemetry via gRPC\n     :4317         \n  \n           \n           \n  \n   Debug Exporter   Displays received data\n  \n  ```\n\n---------\n\nCo-authored-by: Copilot <175728472+Copilot@users.noreply.github.com>\nCo-authored-by: Laurent Qurel <l.querel@f5.com>",
